import React, { Fragment } from 'react';

function App() {
  const name = 'react';

  return (
    <div>
      {name === 'react' ? (
      <h1>This is a {name}.</h1>
      ) : ( 
      <h2>This isn't a {name}.</h2>
      )}
    </div>
  );
}

export default App;
